ga0a(){return"Answer: Try completely closing and reopening the app. If that doesn't help, pull down the screen in the \"Electives\" section to force an update of the campaign list. If the campaign still doesn't appear, it may not be available for your course or major."},
ga0o(){return"Profile, Settings, and Data"},
ga0k(){return"Why does my profile show an old group or major?"},
ga0g(){return"Answer: Profile data is loaded directly from Modeus. If the information is outdated, it means it has not yet been updated in the university's main system. Data is usually corrected after the relevant orders are issued."},
ga0l(){return"Can I change my data (e.g., email) through the app?"},
ga0h(){return'Answer: No. The application works in "read-only" mode. All changes to personal data must be made through official university channels.'},
ga0m(){return'What happens if I click "Log out"? Will my data (favorite schedules) be deleted?'},
ga0i(){return'Answer: When you log out of your account, your authorization token and data cache are cleared from the device. The "Friends" list (favorites) will be saved on your phone and will be available the next time you log in to the same account.'},
ga0n(){return"How often is the data in the app updated?"},
ga0j(){return"Answer: The app tries to download fresh data every time it is launched. You can also force an update at any time by pulling down the screen on the schedule or grades page."},
ga0I(){return"Technical Questions"},
ga0F(){return"The app crashes or freezes. What should I do?"},
ga0C(){return"Answer: Try the following steps: 1) Completely close and reopen the app. 2) Restart your phone. 3) Make sure you have the latest version of the app installed. If the problem persists, contact support, specifying your phone model and describing when the crash occurs."},
ga0G(){return"How much internet data does the app use?"},
ga0D(){return"Answer: Significantly less than the website. The app downloads only raw data without extra interface elements. After the first download, the data is cached, and subsequent updates use minimal data."},
ga0H(){return"I found a bug! What's the best way to report it?"},
ga0E(){return'Answer: The best way is to write to support on Telegram (@JasonVurhyz). Please attach a screenshot and briefly describe the actions that led to the error. For example: "I clicked on electives, and the app crashed. Phone is a Samsung S23." This will greatly help us fix it quickly.'},
ga3Q(){return"Privacy Policy"},
ga3P(){return"Last updated: October 01, 2025"},
ga3R(){return"1. General Provisions"},
ga3K(){return"We value your privacy. This Policy explains what data we process, how, and why. By using the application, you agree to this Policy."},
ga3S(){return"2. What data we DO NOT collect"},
ga3L(){return"We fundamentally DO NOT collect, store, or transfer:\n\n\u2022 Your password for your UTMN account. The login process occurs on the university's official authentication page.\n\u2022 Your personal data for sale or transfer to third parties.\n\u2022 The content of your grades, schedule, etc., on our servers."},
ga3T(){return"3. What data we collect and process"},
ga3M(){return"\u2022 Authentication token: After logging in, the Modeus system issues a temporary digital key (token). We store this token encrypted only on your device, so you don't have to enter your password every time you launch the app.\n\n\u2022 Data from Modeus (cache): The application downloads and temporarily stores (caches) your profile data, schedule, and grades on your device. This is necessary for the app to work quickly and to provide offline access. The cache can be cleared in the app settings.\n\n\u2022 Anonymous usage analytics: We may use tools (e.g., AppMetrica) to collect anonymized statistics: which features are most popular, on which devices crashes occur. This helps us fix bugs and improve the application. This data does not contain personal information (name, email, etc.).\n\n\u2022 Favorite schedules: The list of students or teachers you have added to your favorites is stored locally on your device."},
ga3U(){return"4. Data Security"},
ga3N(){return"All data stored on your device (token, cache) is protected by the standard security mechanisms of your phone's operating system."},
ga3V(){return"5. Your Rights"},
ga3O(){return"You can revoke the application's access to your data at any time by logging out of your account in the app and deleting it."},
