ga4X(){return"We grant you a non-exclusive, non-transferable, revocable license to use the Application for personal, non-commercial educational purposes."},
ga55(){return"4. Limitation of Liability"},
ga4Y(){return'Data Accuracy: The Application displays data "as is," receiving it from the Modeus system. We cannot guarantee its absolute accuracy, completeness, or timeliness. Always check official sources for critically important information.\n\nService Availability: The operation of the Application depends directly on the availability of the UTMN and Modeus servers. We are not responsible for the temporary unavailability of the service for technical reasons beyond our control.\n\nConsequences: The developer is not responsible for any academic, financial, or other problems (e.g., missing a class or exam) arising from the use or inability to use the Application.'},
