ga0m(){return'\u0427\u0442\u043e \u043f\u0440\u043e\u0438\u0437\u043e\u0439\u0434\u0435\u0442, \u0435\u0441\u043b\u0438 \u044f \u043d\u0430\u0436\u043c\u0443 "\u0412\u044b\u0439\u0442\u0438"? \u041c\u043e\u0438 \u0434\u0430\u043d\u043d\u044b\u0435 (\u0438\u0437\u0431\u0440\u0430\u043d\u043d\u044b\u0435 \u0440\u0430\u0441\u043f\u0438\u0441\u0430\u043d\u0438\u044f) \u0443\u0434\u0430\u043b\u044f\u0442\u0441\u044f?'},
