ga0E(){return'\u041e\u0442\u0432\u0435\u0442: \u041b\u0443\u0447\u0448\u0438\u0439 \u0441\u043f\u043e\u0441\u043e\u0431 \u2014 \u043d\u0430\u043f\u0438\u0441\u0430\u0442\u044c \u0432 Telegram \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u043a\u0438 (@JasonVurhyz). \u041f\u043e\u0436\u0430\u043b\u0443\u0439\u0441\u0442\u0430, \u043f\u0440\u0438\u043b\u043e\u0436\u0438\u0442\u0435 \u0441\u043a\u0440\u0438\u043d\u0448\u043e\u0442 \u0438 \u043a\u0440\u0430\u0442\u043a\u043e \u043e\u043f\u0438\u0448\u0438\u0442\u0435, \u043a\u0430\u043a\u0438\u0435 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u043f\u0440\u0438\u0432\u0435\u043b\u0438 \u043a \u043e\u0448\u0438\u0431\u043a\u0435. \u041d\u0430\u043f\u0440\u0438\u043c\u0435\u0440: "\u041d\u0430\u0436\u0430\u043b \u043d\u0430 \u044d\u043b\u0435\u043a\u0442\u0438\u0432\u044b, \u0438 \u043f\u0440\u0438\u043b\u043e\u0436\u0435\u043d\u0438\u0435 \u0432\u044b\u043b\u0435\u0442\u0435\u043b\u043e. \u0422\u0435\u043b\u0435\u0444\u043e\u043d Samsung S23". \u042d\u0442\u043e \u043e\u0447\u0435\u043d\u044c \u043f\u043e\u043c\u043e\u0436\u0435\u0442 \u043d\u0430\u043c \u0431\u044b\u0441\u0442\u0440\u043e \u0432\u0441\u0435 \u0438\u0441\u043f\u0440\u0430\u0432\u0438\u0442\u044c'},
